({
	getDocumentList : function(component, event) {

        var transactionId = component.get("v.transactionId");
        
        var transacListFlowJSON = component.get("v.transactionListFlow");
        var transactionList;
        if (!$A.util.isEmpty(transacListFlowJSON)) {
            transactionList = JSON.parse(transacListFlowJSON);
        }
        console.log("transactionList", JSON.stringify(transactionList));
        
        console.log("transactionId", transactionId);
        /*component.find("navigationService").navigate({ 
                    type: "standard__webPage", 
                    attributes: { 
                   url: 'data:application/pdf;base64,<iframe  allow="geolocation *; microphone *; camera *" frameborder="0" height="400px" id="j_id2" name="j_id2" scrolling="no" src="data:application/pdf;base64,'
                    } 
       });*/
        // call Apex controller
        var action = component.get("c.getDocumentList");
        action.setParams({
            "transactionIdList" : ($A.util.isEmpty(transactionList) ? [transactionId] : transactionList)
        });
        action.setCallback(this, function(response) {
            var state = response.getState();
            if(state === 'SUCCESS') {
                //console.log("response success", JSON.stringify(response));
                component.set("v.documentList", JSON.parse(response.getReturnValue()));
                
                //console.log("response.getReturnValue", JSON.parse(response.getReturnValue()));
                this.getBase64List(component, event);
            } else {
                // error message
                console.log('error', state);
            }
        });
        $A.enqueueAction(action);
	},

    getBase64List : function(component, event) {
    	
        //var vfOrigin = "https://" + component.get("v.vfHost");
       // console.log("component.find(vfFrame).getElement()", component.find("vfFrame").getElement());
        //var vfWindow = component.find("vfFrame").getElement().contentWindow;
        
        var documentList = component.get("v.documentList");
        var docBase64List = [];
        //console.log("sendToVF>message", JSON.stringify(message));
        var listLength = (!$A.util.isEmpty(documentList) ? documentList.length : 0);
        for (var i = 0; i < listLength; i++) {
            var docListLength = (!$A.util.isEmpty(documentList[i].binaryDocList) ? documentList[i].binaryDocList.length : 0);
            for (var j = 0; j < docListLength; j++) {
                docBase64List.push(documentList[i].binaryDocList[j]);
               // console.log("component.find(navigationService)", component.find("navigationService"));
               /* component.find("navigationService").navigate({ 
                    type: "standard__webPage", 
                    attributes: { 
                        url: 'data:application/pdf;base64,' + documentList[i].binaryDocList[j] 
                    } 
                });*/
                //window.location.href = 'data:application/pdf;base64,' + documentList[i].binaryDocList[j];
                
               // vfWindow.postMessage(documentList[i].binaryDocList[j], vfOrigin);
            }
            //console.log("doc",JSON.stringify(documentList[i].binaryDocList));
            //vfWindow.postMessage(documentList[i].binaryDocList, vfOrigin);

        }
        component.set("v.docBase64List", docBase64List);
        console.log("docBase64List", docBase64List);
        
        if ($A.util.isEmpty(docBase64List)) {
            var message;
            var simplePurchasedProduct = component.get("v.simplePurchasedProduct");
            if (!$A.util.isEmpty(simplePurchasedProduct)) {
                if (simplePurchasedProduct.TransactionStHFlag__c) { 
                    message = $A.get("$Label.c.PurchasedProductDocument_HomeDeliveryError");
                } else if (simplePurchasedProduct.Origin__c === 'RMS') {
                    message = $A.get("$Label.c.PurchasedProductDocument_RMSError");
                } else if (simplePurchasedProduct.Origin__c === 'X-STORE') {
                    message = $A.get("$Label.c.PurchasedProductDocument_XStoreError");
                }
            }
            message = ($A.util.isEmpty(message) ? $A.get("$Label.c.PurchasedProductDocument_NoResult") : message);

            component.find('notifLib').showToast({
                "variant" : "error",
                "message": message,
                "mode": "sticky"
            });
            this.consoleCloseTab(component, event);
        }
    },

    consoleSetTabLabel : function(component) {
        var workspaceAPI = component.find("workspace");
        workspaceAPI.isConsoleNavigation().then(function(response) {
            if (response == true) {
                workspaceAPI.getFocusedTabInfo().then(function(response) {
                    var focusedTabId = response.tabId;
                    component.set("v.focusedTabId", focusedTabId);
                    workspaceAPI.setTabLabel({
                        tabId: focusedTabId,
                        label: "Document"
                    });
                })
                .catch(function(error) {
                    console.log(error);
                });
            } else {
                // standard app, go back to the record page
                /*var pageReference = {
                    type: "standard__recordPage",
                    attributes: {
                        "recordId": component.get("v.recordId"),
                        "actionName": "view"
                    }
                };
                var navService = component.find("navService");
                navService.navigate(pageReference, false);*/
                window.history.back();
            }       
        })
        .catch(function(error) {
            console.log(error);
        });
    },

    consoleCloseTab : function(component, event) {
        var workspaceAPI = component.find("workspace");
        workspaceAPI.isConsoleNavigation().then(function(response) {
            if (response == true) {
               // var focusedTabId = component.get("v.focusedTabId");
                workspaceAPI.getFocusedTabInfo().then(function(response) {
                    var focusedTabId = response.tabId;
                    console.log("focusedTabId", focusedTabId);
                    workspaceAPI.closeTab({tabId: focusedTabId});
                });
            }
        })
        .catch(function(error) {
            console.log("error", error);
        });
    }, 
})